import React, { Component } from 'react';

class MainVideoInfo extends Component {

    render () {
        return (
            <>
                <h1 className = "video-info__header">{this.props.title}</h1>
                <h2 className="video-info__h2">By {this.props.channel}</h2>
            </>
        );
    }
}
export default MainVideoInfo;
